import React from "react";



import { useState, useEffect, useContext, createContext } from 'react';
import { BrowserRouter, Route, Routes, Link, useNavigate } from 'react-router-dom'
import { useCookies } from "react-cookie"
import styled from 'styled-components';
import { AppContext } from '../App'
import AccountCircle from '@mui/icons-material/AccountCircle';
import Visibility from '@mui/icons-material/Visibility';
import VisibilityOff from '@mui/icons-material/VisibilityOff';
import { Button, OutlinedInput, FormControl, InputLabel, IconButton, InputAdornment } from '@mui/material';//Conponent function follows
export default function Login() {
// alias useNavigate to navigate
  const [showPassword, setShowPassword] = useState(false);

  const handleClickShowPassword = () => setShowPassword((show) => !show);

  const handleMouseDownPassword = (event) => {
    event.preventDefault();
  };

  const navigate = useNavigate();
  // enable global state variable needed from app.js
  const { isVerified, setIsVerified,
          firstName, setFirstName,
          lastName, setLastName,
          user, setUser } = useContext(AppContext);


// Set local state variables only used in the component
  const [username, setUserName] = useState(''); // stores user input to username
  const [password, setPassword] = useState(''); // stores user input to password
  const [cookie, setCookie] = useCookies(["user"]) // stores cookies and name the cookie "user"
 // check to see if then is an existing active cookie that has user_id, firstname, and lastname
 //if logi9ng cookie (user) exists
  if(cookie.user){
  // get cookie and assign to cookie data
    let cookiedata = cookie.user
    setFirstName(cookiedata[0].firstname);
    setLastName(cookiedata[0].lastname);
    setUser(Number(cookiedata[0].id));
    setIsVerified(true);

  }

  const handleSubmit = async e => {
  e.preventDefault();
  let temp = document.getElementById('user_name').value;
  let temp2 = document.getElementById('password').value;
  setUserName(temp)
  setPassword(temp2)
  loginUser(temp,temp2);
  }

    const handleCreate = async e => {
    e.preventDefault();
    let temp = document.getElementById('user_name').value;
    let temp2 = document.getElementById('password').value;


    await fetch('http://localhost:3001/createuser',{
        method:"POST",
        headers: {'Content-Type': 'application/json'},
        body: JSON.stringify({  firstname: 'John',
                                lastname: 'Doe',
                                username: document.getElementById('user_name').value,
                                password: document.getElementById('password').value})
    })
    .then(res => res.json())
    .then(data => {
        console.log(data)
        if(data.userCreated)
        {   alert("User Created! Logging you in now!")
            setUserName(temp)
            setPassword(temp2)
            loginUser(temp,temp2)
        }else
        {
            alert("Username already taken! Please try again!")
        }
    })
    .catch(err=>alert(`Error during user creation: ${err}`))
  }

    async function loginUser(username, password) {
      var temp = {}
      fetch('http://localhost:3001/login',{
        method:"POST",
        headers: {'Content-Type': 'application/json'},
        body: JSON.stringify({"user":username, "pw":password})
      })
        .then(res => res.json())
        .then(data => {
          console.log('data: ', data)
          setFirstName(data[0].firstname);
          setLastName(data[0].lastname);
          setUser(Number(data[0].id));
          setIsVerified(true);
          navigate("/workouts")
          setCookie("user", JSON.stringify(data), {
            maxAge: 120, // Expires after 5 min
        })
        })
        .catch(err =>{
          document.getElementById("user_name").value='';
          document.getElementById("password").value='';
          navigate("/login")
        })
        }

        console.log('cookie data: ', cookie.user)
        let temp3 = document.cookie.split(';')
        //setCookie2(cookie.user)

//console.log('First: ',firstName)
//console.log('first name from user data; ', userData[0].firstname)
//setFirstName(userData[0].firstname)

  return(

    <LoginWrapper>
      <Form>
      <SignIn>Please Sign In</SignIn>
        <FormControl sx={{ml:2, mr:2, my:1}} variant="outlined">
        <InputLabel htmlFor="user_name">Username</InputLabel>
        <OutlinedInput
          id="user_name"
          startAdornment={
            <InputAdornment position="start">
              <AccountCircle />
            </InputAdornment>
          }
          label="Username"
        />
        </FormControl>
        <FormControl sx={{ml:2, mr:2, my:1}} variant="outlined">
          <InputLabel htmlFor="password">Password</InputLabel>
          <OutlinedInput
            id="password"
            type={showPassword ? 'text' : 'password'}
            endAdornment={
              <InputAdornment position="end">
                <IconButton
                  aria-label="toggle password visibility"
                  onClick={handleClickShowPassword}
                  onMouseDown={handleMouseDownPassword}
                  edge="end"
                >
                  {showPassword ? <VisibilityOff /> : <Visibility />}
                </IconButton>
              </InputAdornment>
            }
            label="Password"
          />
        </FormControl>
        <Button style={submitButton} variant="contained" type="submit" className='loginbutton' onClick = {handleSubmit}>Sign In </Button>
        <Button style={submitButton} variant="contained" type="submit" className='loginbutton' onClick = {handleCreate}>New User </Button>
      </Form>
    </LoginWrapper>
  )
}

const submitButton = {
  borderRadius: '50px',
  margin: '20px'
}

const SignIn = styled.h1`
  margin: 20px;
`

const LoginWrapper = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  height: 100%;
`

const Form = styled.form`
  display: flex;
  flex-direction: column;
  justify-content: space-evenly;
  width: 40%;
  height: 75%;
  box-shadow: 0px 0px 10px 2px black;
`
